import { YMaps, Map } from 'react-yandex-maps';

const Ymap = () => (
  <YMaps>
    <div>
      My awesome application with maps!
      <Map
        defaultState={{
          center: {
            lat: 56.129354,
            lng: 93.335116,
          },
          zoom: 13,
        }}
      />
    </div>{' '}
  </YMaps>
);

export default Ymap;
